INSERT INTO klubbhuset.organization (OID, CREATED, DESCRIPTION, EMAILCONTACT, NAME, PRICEOFMEMBERSHIP, URL) VALUES (10001, '2018-12-01', 'Vi er en fanklubb som består av medlemmer med medium til høyt interessenivå for vår helt Chuck Norris, meld deg inn hvis du vil bli med å diskutere og tilbe gode gamle Chuck over en vaffel!', 'ChuckNorrisResponse@ungspiller.no', 'Chuck Norris fanclub', 999, 'ChuckNorrisIsCool.ungspiller.no');
INSERT INTO klubbhuset.organization (OID, CREATED, DESCRIPTION, EMAILCONTACT, NAME, PRICEOFMEMBERSHIP, URL) VALUES (10002, '2018-12-01', 'Føler du at ingen hjemme respekter det som er ditt? Er hele huset fyllt opp med hjemmelaget slim? Tenker du på å bare dra, uten å si fra? Da er dette klubben for deg! Vi er en gjeng fedre som deler utfordringer fra hverdagen, over kaffe og moffeloff. Siden det allerde er så forferdelig dyrt å ha barn, så er det ingen medlemskontigent. Bli med!', 'fedresupport@ungspiller.no', 'Støttegruppe for fedre', 0, 'fedrestøtte.ungspiller.no');
INSERT INTO klubbhuset.organization (OID, CREATED, DESCRIPTION, EMAILCONTACT, NAME, PRICEOFMEMBERSHIP, URL) VALUES (10003, '2018-12-01', 'Vi er en gjeng Tempo-entusiaster, vi samler oss hver søndag for Tempo-prat og kaffe. Hvis du også er over gjennomsnittet interresert i Tempo! SÅ er dette klubben for deg!', 'guttatempocontact@ungspiller.no', 'Tempoklubben', 199, 'guttatempo.ungspiller.no');
INSERT INTO klubbhuset.organization (OID, CREATED, DESCRIPTION, EMAILCONTACT, NAME, PRICEOFMEMBERSHIP, URL) VALUES (10004, '2019-08-23', 'Linjeforening for Data-, El- og Automasjonsingeniør', 'epsiloncontact@uials.no', 'Epsilon', 200, 'epsilon.uials.no');